import axios from "axios";
import { tryCatchHandlr } from "../../shared/helpers";

export const submitHandlr = async (e, isLogin) => {
    e.preventDefault();

    const payload = {};

    for(const [i, el] of [...e.target].entries()){
        //to omit submit value to payload
        if(i+1 === e.target.length) break;

        console.log(e.target);
    }

    const registerReq = axios
        .post('/users/register',
            {
                'email': 'email@email.com',
                'password': 'password1'
            },
            {headers: {
                "Content-Type": "application/json",
            }}, 
        );

    const [data, error] = await tryCatchHandlr(registerReq);

    console.log(data, error);
};
